import React, {Component} from 'react';
import './BuildList.css';
import './BuildListItem.css';
import BuildListItem from './BuildListItem';
import SimpleBar from 'simplebar-react';
import 'simplebar/dist/simplebar.min.css';
import { db } from '../../utils/Firebase';
import HeroTalentIcon from '../heroTalents/HeroTalentIcon';

// accept a userid, if no id provided get all builds with page limits
// if an id is passed, get the builds for this user only

class BuildList extends Component {
  constructor(props) {
    super(props);

    console.log('build list props');
    console.log(props);

    this.state = {
      userId: props.userId,
      isFetchingData: false,
      data: null
    };
  }

/*   componentDidMount () {
    console.log('component mounted, getting docs for user id ');
    console.log(this.state.userId);
    this.setState({ isFetchingData: true });

     db.collection('builds').where("userId", "==", this.state.userId).get().then((querySnapshop) => {
      var documents = [];
      querySnapshop.forEach((doc) => {
        documents.push({
          id: doc.id,
          data: doc.data()
        });
        console.log(doc.id);
        console.log(doc.data());
      });
      console.log('documents retrieved ' );
      console.log(documents);
      this.setState({
        isFetchingData: false,
        data: documents
      });
    }).catch((error) => {
      console.error('Error getting builds from DB', error);
    });
  } */

/*   loadBuildData() {

    if (this.props.userId) {
      console.log('loading builds from db for user id');
      console.log(this.props.userId);

      db.collection('builds').where("userId", "==", this.props.userId).get().then((querySnapshop) => {
        var buildHtml = [];
        querySnapshop.forEach((doc) => {
          console.log(doc.id);
          console.log(doc.data());
          buildHtml.push(this.renderBuildListItem(doc));
        });
        console.log(buildHtml);
        this.state.builds = querySnapshop;
        return buildHtml;
      }).catch((error) => {
        console.error('Error getting builds from DB', error);
      });
    }

  } */

  renderBuildListItem(buildId, buildData) {
    return <div className="build-list-item border-02 background7">
              <div className={`build-hero-icon hero-icon-${buildData.careerId} border-04`}></div>
              <p className="build-name">Yer Best Friend Kruber</p>
              <div className="build-description-container">
                  <p className="build-hero">Mercenary</p>
                  <p className="build-author">B-Fir3</p>
              </div>
              <p></p>
              <div className="talents">
                <HeroTalentIcon talentNumber={buildData.talent1} tier={1} careerId={buildData.careerId}></HeroTalentIcon>
                <HeroTalentIcon talentNumber={buildData.talent2} tier={2} careerId={buildData.careerId}></HeroTalentIcon>
                <HeroTalentIcon talentNumber={buildData.talent3} tier={3} careerId={buildData.careerId}></HeroTalentIcon>
                <HeroTalentIcon talentNumber={buildData.talent4} tier={4} careerId={buildData.careerId}></HeroTalentIcon>
                <HeroTalentIcon talentNumber={buildData.talent5} tier={5} careerId={buildData.careerId}></HeroTalentIcon>
                <HeroTalentIcon talentNumber={buildData.talent6} tier={6} careerId={buildData.careerId}></HeroTalentIcon>
              </div>
              <div className="weapons">
                <div className="weapon-icon weapon-01 weapon-background border-10"></div>
                <div className="trait-icon trait-parry border-10"></div>
                <div className="weapon-icon weapon-02 weapon-background border-10"></div>
                <div className="trait-icon trait-conservative-shooter border-10"></div>
              </div>
              <div className="traits">
                <div className="trait-icon trait-barkskin border-10"></div>
                <div className="trait-icon trait-proxy border-10"></div>
                <div className="trait-icon trait-shrapnel border-10"></div>
              </div>
              <div className="build-footer">
                  <p className="patch-number">Tank - Legend - v2.0.8</p>
                  <div></div>
              </div>
            </div>;
  }

  render() {

/*     if (!this.state.data) {
      return <div className="build-list border-01 background-16">
                <p>No Builds</p>
              </div>
    }

    if (this.state.isFetchingData) {
      return <div className="build-list border-01 background-16">
              <p>Loading data</p>
            </div>
    }

    console.log('builds data fetched ');
    console.log(this.state.data);

    this.state.data.forEach((doc) => {
      console.log('document from data ');
      console.log(doc.id);
    }); */

    console.log('rendering build list for user ' + this.props.userId);
    console.log(this.props.builds)

    return (
          <div className="build-list border-01 background-16">
            {this.renderBuilds(this.props.builds)}
          </div>
    );
  }

  renderBuilds(builds) {
    console.log('list of builds to render');
    console.log(builds);
    if (!builds || builds.length == 0) {
      return <p>No {this.props.name} in database.</p>;
    }
    var buildsHtml = [];
    builds.forEach((build) => {
      console.log('build item');
      console.log(build.data);
      buildsHtml.push(build.id, this.renderBuildListItem(build.id, build.data))
    });
    return buildsHtml;
  }
}

export default BuildList;
